import React from 'react'

function Footer() {
  return (
    <div>
      <footer className="py-5 bg-black">
            <div className="container px-5"><p className="m-0 text-center text-white small">Copyright &copy; Your Website 2022</p></div>
        </footer>
    </div>
  )
}

export default Footer
